                        Somos un servicio de rescate médico que se conecta con usted al instante que nos llama, y lo acompaña durante todo el proceso de solución de la emergencia o imprevisto de salud.
                    </Typography>
                </Grid>

                <Grid item container xs={6}>
                    <Grid item xs={3}>

